import React from 'react';
import stl from './Posts.module.css';
import Post from './Post/Post';

const Posts = () => {
    return (
        <div>
            My posts
            <div>
                <textarea></textarea>
                <button>Add Post</button>
            </div>
            <div className={stl.posts}>
                <Post likes="15" message="А чё, думали я по-русски писать разучился?" />
                <Post likes="20" message="Second post - а енто типа по енглишу :-)" />
            </div>
        </div>
    );
}

export default Posts;
